import React from 'react';

import {Link} from 'react-router-dom';


export const phone = (props) => {
    return (
        <div>
            <h2>Phone:</h2>
            {props.phones.map((phone, index) => {
                return (
                    <div key={phone.id}>
                        <h3>
                            <Link 
                            to={`/phone/${phone.id}`}>
                            {phone.name}</Link>
                        </h3>
                        <h4>{phone.manufacturer}</h4>
                        <h4>{phone.description}</h4>
                        <h4>{phone.color}</h4>
                        <h4>{phone.price}</h4>
                        <h4>{phone.screen}</h4>
                        <h4>{phone.processor}</h4>
                        <h4>{phone.ram}</h4>
                    </div>
                )
            })}

        </div>
    )
};
